      this.message, 
      this.totalData, 
      this.data,});

  TransactionModel.fromJson(dynamic json) {
    status = json['status'];
    code = json['code'];
    message = json['message'];
    totalData = json['total_data'];
    if (json['data'] != null) {
      data = [];
      json['data'].forEach((v) {
        data?.add(DataTransaction.fromJson(v));
      });
    }
  }
  bool? status;
